//https://leetcode.com/problems/sliding-window-maximum
class Solution {
public:
    vector<int> maxSlidingWindow(vector<int>& nums, int k) {
        if(k == 1)
            return nums;
        vector<int> res;
        int start = 0;
        int end = 0;
        priority_queue<pair<int, int>> pq;
        while(end < k-1 && end < nums.size()){
            pq.push({nums[end], end});
            end++;
        }
        while(end < nums.size()){
            pq.push({nums[end], end});
            while(pq.size() > k && pq.top().second < start){
                pq.pop();
            }
            res.push_back(pq.top().first);
            if(pq.top().second == start)
                pq.pop();
            start++;
            end++;
        }
        return res;
    }
};

